import React, { useEffect } from 'react';
import { Container, Typography, Paper, Button } from '@mui/material';
import { useNavigate } from 'react-router-dom';
import AOS from 'aos';
import 'aos/dist/aos.css';

const PageNotFound = () => {
    const navigate = useNavigate();

    useEffect(() => {
        AOS.init({ duration: 2000 });
    }, []);

    const pageNotFoundStyles = {
        padding: '40px',
        textAlign: 'center',
        backgroundColor: '#2E3B55',
        color: '#FFFFFF',
        borderRadius: '20px',
        boxShadow: '0 18px 36px rgba(0, 0, 0, 0.5)',
    };

    return (
        <Container maxWidth="md" style={{ marginTop: '40px' }}>
            <Paper style={pageNotFoundStyles} data-aos="fade-up">
                <Typography variant="h3" gutterBottom>404 - Page Not Found</Typography>
                <img
                    src="data:image/jpeg;base64,"
                    alt="4 0 4 PAGE NOT FOUND"
                    style={{ width: '100%', height: 'auto', borderRadius: '10px', marginBottom: '20px' }}
                    loading="lazy"
                    data-aos="fade-up"
                />
                <Typography variant="body1" paragraph>
                    Oops! It seems like you've ventured into unknown territory. The page you're looking for cannot be found.
                </Typography>
                <Button
                    variant="contained"
                    color="secondary"
                    onClick={() => navigate('/')}
                    style={{ marginTop: '20px' }}
                >
                    Go Back Home
                </Button>
            </Paper>
        </Container>
    );
}

export default PageNotFound;